"Colorful Grid Accent 5\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light Grid Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Shading 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Shading 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium List 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium List 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 3 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Dark List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">一年之计在于春，万物复苏的季节，时而细雨润物，时而阳光明媚，人在此时都是元气满满的。很多家庭都会选择开春之后进行装修。那么，家庭装修有什么注意事项？有哪些装修技巧？小编总结得出以下八大装修技巧，助你轻松打造个性家居。</span></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第一，挑选瓷砖时，最好先咨询设计师，画好排砖图，按图计算所需瓷砖的面积与数量，再去购买瓷砖。购买的瓷砖要依据实用场景不同而分类购买；瓷砖的花色最好选择&ldquo;平对花色、图案&rdquo;要求不高的瓷砖，以免在实际瓷砖铺贴过程中因为切割而损坏美观度。</span><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; text-decoration: underline;\\\\\">哈德逊瓷砖天猫旗舰店</span><span style=\\\\\"font-family: 宋体;\\\\\">客服都经严格培训，在瓷砖搭配上技巧高超，深受买家好评。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第二，巧妙利用腰线、花片等与其他瓷砖的拼接，可以很大程度上的减少切割几率，同时也在空间视觉上提高丰富度。如</span><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; text-decoration: underline;\\\\\">哈德逊瓷砖</span><span style=\\\\\"font-family: 宋体;\\\\\">的&ldquo;欧式仿古小花砖&rdquo;就是很多人在客厅瓷砖搭配时用到的热销瓷砖配件。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: center;\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"461\\\\\" alt=\\\\\"装修技巧,个性家居,装修注意事项.jpg\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-27/86026897cc526f59b7e4ec1c957406fe.jpg\\\\\" /></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第三，塑钢门的时候一定要预留塑好钢门之后墙壁可能突出墙面整体的尺寸，使得最后贴完瓷砖后门框和墙面是统一平面上的，提高美感。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第四，在铺贴瓷砖时，如果是自己动手，一定要看好</span><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; text-decoration: underline;\\\\\">瓷砖铺贴的注意事项</span><span style=\\\\\"font-family: 宋体;\\\\\">，紧跟步骤来做，不偷工减料。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第五，尽量在客厅、房间的四个角都安装电源插头，这个太重要了，你也不想到时候给手机充个电也满房子找空闲的插头吧？</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第六，做门与门框的材料最好选木纹细致的材料，因为们安装了之后，通常不会轻易的改装，就像瓷砖一样，所以需要选耐用结实的。而木纹细致的材料通常较耐用，而且热胀冷缩程度较低。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第七，卧室灯、走廊灯、楼梯灯最好是双控的。道理你懂的，当大冬天窝在温暖的被窝里的时候，想关灯时伸手一按就行了总比起床穿鞋关冷回来拖鞋上床好吧？走廊灯和楼梯灯就更不用说了，如果只有一头有灯，开灯走到另一头后要肿么关灯？！跑回去关灯？！多么麻烦。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第八，如果是把装修外包，最好选择技术高、口碑好的团队。房子装修很可能是一辈子的事，轻易不要敷衍，而且技术高的工人在装修时，在一定程度上可以提高原材料使用率，降低因切割失误、安装失误等等导致的无谓损失。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">哈德逊瓷砖秉承品质取胜，设计高雅的理念，每件产品都是精雕细琢，加上价格实惠，一直风靡全国消费者，哈德逊瓷砖身影陆续出现在全国各大家庭装修上；同时，哈德逊瓷砖还远销海外，实力出众，是很多海外家庭的选择。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"margin-left:0.0000pt; text-indent:21.0000pt; mso-pagination:widow-orphan; text-align:left; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">文章来源：哈德逊瓷砖编辑原创</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">转载请注明出处</span><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\">http://www.hudsonhome.cn</span><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\">&ensp;</span></span></p>\r\n<p>&nbsp;</p>');");
E_D("replace into `phome_ecms_news_data_1` values('1917','8','1920','1','0','0','0','','','','<p><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">随着甲醛致癌的新闻信息的扩散，除甲醛的有效方法已经成为了现代装修最受热议的话题。过度吸入甲醛会对人体免疫器官、眼耳鼻喉、皮肤、肝功能等造成损害，严重时甚至可致癌、胎儿畸形等等，是现在家居生活里的隐形杀手。你是否好奇过：装修过程中为什么会产生甲醛？</span></span></p>\r\n<p><span style=\\\\\"font-size: 14px;\\\\\"><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\\\\\"false\\\\\"  DefUnhideWhenUsed=\\\\\"true\\\\\"  DefSemiHidden=\\\\\"true\\\\\"  DefQFormat=\\\\\"false\\\\\"  DefPriority=\\\\\"99\\\\\"  LatentStyleCount=\\\\\"260\\\\\" >\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Normal\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 1\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 2\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 3\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 4\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 5\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 7\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 8\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\