\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 5\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 5\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light Grid Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Shading 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Shading 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium List 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium List 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 3 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Dark List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">装修过程中之所以会产生甲醛，是因为在装修过程中，甲醛是作为粘合剂出现的，可以说只要用到粘合胶的地方就会有甲醛。通常来说，吊顶、墙纸、腻子、复合板家具或地板中，都会含有甲醛。现在比较流行的复合地板，除了安装时要用到大量的粘合剂，木地板本身也是一个很大的甲醛来源。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">所以现在人们在选择木地板时都会三思。更多的人转而选择瓷砖来铺地，因为瓷砖无论在生成和安装过程中，都不会牵涉到甲醛。这在很大程度上降低了新居中的甲醛污染。如</span></span><span><a href=\\\\\"http://www.hudson.com/xwzx/qyxw/2014-10-23/1046.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">佛山品牌瓷砖</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">哈德逊，以高品质产品为核心，坚持技术创新，产品质量全面通过中国国家强制性产品认证<font face=\\\\\"Times New Roman\\\\\">(</font><font face=\\\\\"宋体\\\\\">&ldquo;</font><font face=\\\\\"Times New Roman\\\\\">3C</font><font face=\\\\\"宋体\\\\\">&rdquo;认证</font><font face=\\\\\"Times New Roman\\\\\">)</font><font face=\\\\\"宋体\\\\\">，中国质量管理体系认证、中国环保产品认证，高于国家</font><font face=\\\\\"Times New Roman\\\\\">GB6566-2001A</font><font face=\\\\\"宋体\\\\\">类装修材料标准，以优质的产品服务全球千家万户，进驻各个高端地标项目，如南通中南项目、武汉新浩项目、马来西亚万恒酒店等。</font></span></span><span><a href=\\\\\"http://www.hudson.com/xwzx/qyxw/2014-10-27/1100.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">性价比高的瓷砖</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">能极大程度上的减少装修过程中可能产生的甲醛，对家人的健康是一道很好的保障。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: center;\\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;<span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"360\\\\\" alt=\\\\\"新房除甲醛,除甲醛最有效方法,装修去甲醛.jpg\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-28/38a2318d7ab4a67b225a9cd697052c98.jpg\\\\\" /></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">除了在地板铺设材料上的选择从木地板转换到瓷砖之外，家庭装修中的很多地方还是会用到带甲醛的材料，那么，有哪些除甲醛的最有效方法呢？</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">市面上林林种种号称最有效除甲醛的产品，到底效果真如他们宣称的那么好吗？其实，最天然的植物除甲醛法只对轻微污染环境有效；甲醛清洁剂、光触媒等利用化学反应除甲醛也会对人体造成二次伤害；空气清新剂只是掩耳盗铃；民间土方如点蜡烛意在使甲醛转化但其实消耗了大量氧气而且蜡烛燃烧过程中也会释放有害物质；竹炭吸附也不靠谱，市面上的竹炭大多没经活性处理，甲醛吸附性很低。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">最有效的除甲醛方法是用活性炭，活性炭是经过活性处理的含碳有机材料，处理后的多孔结构可以增加活性炭吸附有害物质的能力，大大降低空气中甲醛含量。一般新装修居室每平方米一包（<font face=\\\\\"Times New Roman\\\\\">50g</font><font face=\\\\\"宋体\\\\\">）的活性炭用量效果最好。</font></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">以上哈德逊瓷砖小编解答了装修过程中为什么会产生甲醛？以及提供了除甲醛最有效方法。希望能对各位的除甲醛提供帮助。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"margin-left:0.0000pt; text-indent:21.0000pt; mso-pagination:widow-orphan; text-align:left; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">文章来源：哈德逊瓷砖编辑原创</span><br />\r\n</span></p>\r\n<p style=\\\\\"margin-left:0.0000pt; text-indent:21.0000pt; mso-pagination:widow-orphan; text-align:left; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">转载请注明出处</span></span><span><a href=\\\\\"http://www.hudson.com/\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\" class=\\\\\"15\\\\\">http://www.hudsonhome.cn</span><span style=\\\\\"font-family: 宋体; color: rgb(102, 102, 102); letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\" class=\\\\\"15\\\\\">&ensp;</span></span></a></span></p>\r\n<p>&nbsp;</p>');");
E_D("replace into `phome_ecms_news_data_1` values('1918','8','1606,1604,1461,1455,975,969','1','0','0','0','','','','<p><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">阳台作为家居设计中不可或缺的一员，在平衡空间、增强采光上都有重要的作用，而且是早晨早操、午后休闲、夜晚聚友的场所，更是侍弄花草、养龟养鱼的好地儿。现代人们对阳台的功能性和观赏性都具有很高的要求，阳台装修设计渐渐热门。那么阳台装修用什么地砖好？佛山知名瓷砖品牌哈德逊瓷砖怎么样？</span></span></p>\r\n<p><span style=\\\\\"font-size: 14px;\\\\\"><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\\\\\"false\\\\\"  DefUnhideWhenUsed=\\\\\"true\\\\\"  DefSemiHidden=\\\\\"true\\\\\"  DefQFormat=\\\\\"false\\\\\"  DefPriority=\\\\\"99\\\\\"  LatentStyleCount=\\\\\"260\\\\\" >\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Normal\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 1\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 2\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 3\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 4\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 5\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 7\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 8\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Pri